import React from 'react';
import CarService from '../services/CarService';

class CarComponent extends React.Component{
    
    constructor(props){
        super(props);
        this.state={
            cars:[]
        }
    }

    componentDidMount(){
        CarService.getCars().then((result) => {
            this.setState({cars: result.data})
        }).catch((err) => {
            
        });
    }

    render(){
        return(
        <div>
            <h1 className="text-center">Car List</h1>
            <table className="table table-striped">
                <thead>
                    <tr>
                        <td> car id </td>
                        <td> car name </td>
                    </tr>
                </thead>
                <tbody>
                    {
                        this.state.cars.map(
                            car =>
                            <tr key={car.id}>
                                <td>{car.id}</td>
                                <td>{car.name}</td>
                            </tr>
                        )
                    }
                </tbody>
            </table>
        </div>
        );
    }
}

export default new CarComponent();
